import React from "react";
import AxiosPosts from "../../Routes/postRoutes";

const DisplayPosts = ({ postList }) => {
  return (
    <div>
      {postList.map((post) => {
        return (
          <div>
            <Routes>
            <Route></Route>
            <Route path="/register" element={<RegisterPage />} />

            </Routes>
            <div>{post.body}</div>
          </div>
        );
      })}
    </div>
  );
};

export default DisplayPosts;
